import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import Store from "./store/store";

interface State {
    store: Store,
}

export const store = new Store();

const root = ReactDOM.createRoot(
    document.getElementById('root') as HTMLElement
);
root.render(
    <App/>
);
